package net.jeeshop.services.manage.questionnaireResult.bean;import java.io.Serializable;import net.jeeshop.core.dao.page.PagerModel;/** * 问卷结果对象 * @author huangf * */public class QuestionnaireResult extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String qid;	private String account;	private String qItemID;	private String text;	public void clear() {		super.clear();		id = null;		qid = null;		account = null;		qItemID = null;		text = null;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getQid() {		return qid;	}	public void setQid(String qid) {		this.qid = qid;	}	public String getAccount() {		return account;	}	public void setAccount(String account) {		this.account = account;	}	public String getqItemID() {		return qItemID;	}	public void setqItemID(String qItemID) {		this.qItemID = qItemID;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}}